MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "The Calibre source-mask optimization (SMO) solution extends existing processes with next-generation computation lithography that enhances the imaging capability of lithographic systems used in the manufacturing of integrated circuits.");
MGCAddSnippet(5, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(6, "Source-Mask optimization accomplishes simultaneous source and mask optimization for each design. Optimization maximizes the imaging process window. To that end, the Calibre SMO solution leverages emerging flexibility of scanners to deliver pixelated illumination and adjusts optical properties for each individual illumination pixel. ");
MGCAddSnippet(7, "The Calibre SMO solution is integrated with the CalibreWORKbench engine. It produces both a manufacturable mask and an optimized source. Generally process engineers run SMO early in the process setup phase to define the achievable technology possibilities.");
MGCAddSnippet(8, "Before starting Calibre pxSMO and the RET Selection tool, you need to have certain required files and licenses.");
MGCAddSnippet(9, "The RET Selection interface is available in the standard Calibre WORKbench menus. ");
MGCAddSnippet(10, "You need to be familiar with some organizing principles in order to use Calibre pxSMO and the RET Selection interface efficiently.");
MGCAddSnippet(11, "Calibre pxSMO source-map optimization is most easily set up using the RET Selection interface. It prompts you for required settings and makes it easy to select critical areas.");
MGCAddSnippet(12, "The RET Selection interface automates communication between the point tools you use in an optimization run. This means the first step is to define the parts shared by the tools: layout, gauges, and models. ");
MGCAddSnippet(13, "A session is a particular combination of gauges, models, and point-tool configurations. After loading the layouts and gauges, you need to define the tool configurations of your sessions before you can run.");
MGCAddSnippet(14, "Although you are required to use a single gauge file for all sessions within a layout/gauge pair, you do not have to run the same gauges for all sessions. You can selectively enable and weight gauges for different SMO runs.");
MGCAddSnippet(15, "A benefit of the RET Selection interface is that you only need to define the process window conditions once. After they are set up in the session browser you can add or remove them from the tool setups with the click of a mouse.");
MGCAddSnippet(16, "You can anchor the litho model threshold to a gauge that is critical to the design. ");
MGCAddSnippet(17, "The RET Selection GUI shows you which parts of your session have valid configurations. You can set up a basic run with just a few clicks, or customize nearly every aspect. The Session Browser pane is located to the right of the Run Control/Layout Session View pane in the default layout when you have a session selected.");
MGCAddSnippet(18, "As an alternative to the pxOPC engine, you can optimize the mask using the nmOPC engine.");
MGCAddSnippet(19, "The Custom OPC Flow Editor lets an advanced user build new OPC flows. ");
MGCAddSnippet(20, "The Parametric Explorer tests different source shapes to find the best candidate for a diffractive optical element (DOE) to use with a design. While most of the job setup between Free-Form pxSMO and Parametric Explorer is similar, some differences exist. This procedure describes the steps that are specific to setting up Parametric Explorer runs.");
MGCAddSnippet(21, "After the first session has been created, you can create variations on the setup to run a series of experiments. ");
MGCAddSnippet(22, "Conditions and settings from an existing session can be used in another session with a different layout/gauge pair. ");
MGCAddSnippet(23, "Even fast runs take several hours and you may sometimes wonder if calculations are progressing. The RET Selection GUI offers several ways to check on sessions.");
MGCAddSnippet(24, "The easiest way to set up batch mode runs is to start from the RET Selection interface. ");
MGCAddSnippet(25, "The RET Selection interface offers four types of relocatable containers for sessions and results.");
MGCAddSnippet(26, "To save space, session directories in the database contain references to shared information such as the layout and gauges. To move the session to another location it must first be exported in order to include the referenced information.");
MGCAddSnippet(27, "The optimized source is saved in the session output directory in the source_sopxopc.src file by default. (You can specify a different name with the output_source command.) This file is the data shown in the RET Selection GUI source thumbnails.");
MGCAddSnippet(28, "After a session has been run, you can view the session s metrics and source in the Result tab. To compare session results, click Inter-Plots and select either Sessions In this Layout or Selected Sessions.... There are also additional steps you can take to better decide which source is best for your process.");
MGCAddSnippet(29, "The RET Selection GUI provides several pre-defined criteria and a means to automatically calculate how close a source comes to meeting the layout specification. ");
MGCAddSnippet(30, "The first step of comparing optimized sources is to check that the session results fit your needs. The RET Selection window provides many ways of accessing single-session plots.");
MGCAddSnippet(31, "A quick way to compare the results of many sessions is to calculate a  goodness  score.");
MGCAddSnippet(32, "You may want to compare SMO results against the source used by your process of record. You can use the RET Selection GUI to more precisely measure the results.");
MGCAddSnippet(33, "When refining an optical source, sometimes you will set up multiple layout/gauge pairs, each with many sessions in order to analyze sources across a wide variety of typical layer geometries. You can compare the source performance by looking at exposure latitude (EL) versus depth of focus (DOF) for multiple sessions within the RET Selection GUI.");
MGCAddSnippet(34, "Calibre pxSMO options are contained in a litho setup file. This file is generally created using the RET Selection interface. This chapter explains the commands and arguments.");
MGCAddSnippet(35, "Litho setup files are used by most Calibre post-tapeout tools to specify local settings and encapsulate product-specific commands. You can quickly generate a Calibre pxSMO or Calibre pxOPC setup file using the RET Selection window in Calibre WORKbench.");
MGCAddSnippet(36, "The Calibre pxSMO setup file commands can be added to an SMO setup file.");
MGCAddSnippet(37, "Identifies an anchor gauge.");
MGCAddSnippet(38, "Enables optimization with anchoring to a gauge.");
MGCAddSnippet(39, "Scales aerial image from negative assist features.");
MGCAddSnippet(40, "Scales print image from negative assist features.");
MGCAddSnippet(41, "Scales aerial image from positive assist features.");
MGCAddSnippet(42, "Scales print image from positive assist features.");
MGCAddSnippet(43, "Writes optimization rates to stdout.");
MGCAddSnippet(44, "Deletes the pixel SOCS directory after reading it.");
MGCAddSnippet(45, "Reads clip periodicity information from the clips.dat file when custom clips are used.");
MGCAddSnippet(46, "Sets parts of a source to fixed illumination levels to allow optimization on the remaining parts of the source.");
MGCAddSnippet(47, "Optimizes source pixel intensities in a specified part of a source while other pixels remain fixed.");
MGCAddSnippet(48, "Identifies the initial mask.");
MGCAddSnippet(49, "Sets the initial source type, overriding any optical sources passed in the litho model.");
MGCAddSnippet(50, "Specifies how many iterations the job should run.");
MGCAddSnippet(51, "Calls the various phases and allows local overrides of settings.");
MGCAddSnippet(52, "Defines layer characteristics such as name and type.");
MGCAddSnippet(53, "Activates curvilinear MRC constraints.");
MGCAddSnippet(54, "Constrains maximum internal spacing during MRC for SRAFs only.");
MGCAddSnippet(55, "Constrains the minimum SRAF area during MRC.");
MGCAddSnippet(56, "Sets a preferred edge length for Manhattan MRC geometries.");
MGCAddSnippet(57, "Constrains external spacing during MRC.");
MGCAddSnippet(58, "Constrains external spacing during MRC between a main feature and an SRAF.");
MGCAddSnippet(59, "Constrains external spacing during MRC for SRAFs only.");
MGCAddSnippet(60, "Sets the minimum distance between two internal edges.");
MGCAddSnippet(61, "Constrains internal spacing during MRC for SRAFs only.");
MGCAddSnippet(62, "Sets the minimum distance between two internal edges for Manhattan shapes.");
MGCAddSnippet(63, "Sets the minimum distance between two internal edges for Manhattan shapes.");
MGCAddSnippet(64, "Sets the minimum distance between two internal edges for Manhattan shapes.");
MGCAddSnippet(65, "Sets the minimum area for features on the mask for Manhattan shapes.");
MGCAddSnippet(66, "Sets the minimum distance between two internal edges for Manhattan shapes.");
MGCAddSnippet(67, "Sets the minimum distance between two internal edges for Manhattan shapes.");
MGCAddSnippet(68, "Optimizes a region using specified objectives.");
MGCAddSnippet(69, "Optimizes the dose threshold when anchoring to a gauge.");
MGCAddSnippet(70, "Specifies the name of the file for the optimized source map. If this is not specified, the source is written to output_source_1.src or output_source_2.src for the first and second exposures, respectively.");
MGCAddSnippet(71, "Outputs an illuminator-level source map file at the end of a session run.");
MGCAddSnippet(72, "Recommended. Enables distributed processing.");
MGCAddSnippet(73, "Defines the mask shapes that represent features.");
MGCAddSnippet(74, "Specifies a new directory in which to cache optical models, potentially improving runtime.");
MGCAddSnippet(75, "Specifies the minimum percentage of pixels to illuminate in the source.");
MGCAddSnippet(76, "Creates print image conditions for dose, focus, resist, and aerial threshold.");
MGCAddSnippet(77, "Creates a group of dose and focus conditions located along a defined process window shape before optimization.");
MGCAddSnippet(78, "Specifies defocus conditions for through-focus aerial image calculation. For job types other than CDOF, this command is required when focus_range or focus_center is specified by the pw_variables command.");
MGCAddSnippet(79, "Controls the relative emphasis given to common depth of focus during process window optimization.");
MGCAddSnippet(80, "Restricts simulation to only the specified processes.");
MGCAddSnippet(81, "Requires the process window conditions for a process window condition group to produce contours within a specified area. Used when optimizing common depth of focus.");
MGCAddSnippet(82, "Specifies the variables for process window optimization.");
MGCAddSnippet(83, "Sets a source to use as a reference during optimization.");
MGCAddSnippet(84, "Specifies the input layers and process window contours to save for CDOF jobs. Only valid for CDOF jobs.");
MGCAddSnippet(85, "Specifies the name of an OASIS file of all clips to save at the end of a job.");
MGCAddSnippet(86, "Specifies the name of a file of contours of all clips to save at the end of a job.");
MGCAddSnippet(87, "Outputs a source map file at the end of a job using the specified name.");
MGCAddSnippet(88, "Outputs an illuminator-level source map file at the end of a job using a specified name.");
MGCAddSnippet(89, "Sets source parameters to values typical for different manufacturers.");
MGCAddSnippet(90, "Specifies where to place SRAFs relative to the target layer.");
MGCAddSnippet(91, "Identifies how far from the target the SRAF rings should extend.");
MGCAddSnippet(92, "Specifies the minimum distance between the main feature and positive SRAFs.");
MGCAddSnippet(93, "Specifies the minimum distance between the main feature edge and negative SRAFs.");
MGCAddSnippet(94, "Sets whether scatter_offset and scatter_offset_negative are calculated based on mask or target shapes.");
MGCAddSnippet(95, "Improves EPE for the nominal process window condition.");
MGCAddSnippet(96, "Controls the source manufacturability constraint on maximum allowable sigma for the optimized source.");
MGCAddSnippet(97, "Controls the source manufacturability constraint on minimum allowable sigma for the optimized source.");
MGCAddSnippet(98, "Sets the importance of the source similarity when the sample_source command is used.");
MGCAddSnippet(99, "Specifies the symmetry of the optimized source.");
MGCAddSnippet(100, "Specifies SRAF printing suppression for process window conditions or process window condition groups.");
MGCAddSnippet(101, "Specifies a subset of variables to optimize.");
MGCAddSnippet(102, "Specifies the version to use.");
MGCAddSnippet(103, "Sets the default weight.");
MGCAddSnippet(104, "Identifies polygon layers which define more important areas for optimization.");
MGCAddSnippet(105, "To help you access functionality, this chapter lists the major windows, tabs, fields, and menus of the RET Selection GUI. All panes of the window are able to be undocked, rearranged, and stacked with other panes.");
MGCAddSnippet(106, "The RET Selection window provides an easy way to set up Calibre pxSMO runs, analyze results, and create scripts to execute future runs from the command line.");
MGCAddSnippet(107, "The Run Control pane displays the status of currently running sessions and allows you to quickly start multiple runs. ");
MGCAddSnippet(108, "The Gauge Analysis pane shares space with the Session Browser pane. During session setup, Gauge Analysis lets you select and configure gauges for the pxSMO portion of the run.");
MGCAddSnippet(109, "During session setup, the Clips and Gauges Editor lets you create and manage clips and gauges. ");
MGCAddSnippet(110, "The Session Browser window offers quick access to setup and results. It is only drawn when a session is selected.");
MGCAddSnippet(111, "The PW Table pane manages all the process window conditions used by the session.");
MGCAddSnippet(112, "The Pre-SMO setup pane enables setup of the curve target and tolerance bands before run execution, or viewing of settings when the run is complete.");
MGCAddSnippet(113, "The pxSMO setup pane enables quick setup of the SMO run before execution, or viewing of settings when the run is complete.");
MGCAddSnippet(114, "The anchoring setup dialog box enables adjusting the threshold used by a litho model to print a specified anchor gauge on target using a specified mask bias. ");
MGCAddSnippet(115, "The Objective Region tab assigns process window conditions to objective regions.");
MGCAddSnippet(116, "The pxSMO Job:cDOF pane enables setup of the SMO run to maximize common depth of focus before execution, or viewing of settings when the run is complete. If EL/ILS optimization is selected, the labels change to Job:EL and the SMO run will maximize exposure latitude. ");
MGCAddSnippet(117, "The Custom OPC Flow Editor enables an advanced user to build custom OPC flows with different OPC, mask bias, and SRAF setups.");
MGCAddSnippet(118, "Enables quick setup of the Calibre OPCverify run before execution and configuration of the Process Window Analysis plot.");
MGCAddSnippet(119, "There are four plot access points. Two of them open windows with multiple plots.");
MGCAddSnippet(120, "The Inter-Plots window shows selected plots for groups of sessions within a layout/gauge pair.");
MGCAddSnippet(121, "An individual plot window charts a single property across a group of sessions. Undocking the window allows easier access to controls and resizing for legibility.");
MGCAddSnippet(122, "The Process Window plot shows the common process window, best focus, and best dose across the gauges of the session. It displays two types of plots in separate tabs - a Common Process Window (CPW) and exposure latitude (EL) versus depth of focus (DOF) plot. It provides controls to toggle individual gauges or adjust model settings to quickly see how they affect the CPW or EL vs DOF values.");
MGCAddSnippet(123, "The Parametric Plot shows the results of source explorations when the Parametric Explorer session mode is used. ");
MGCAddSnippet(124, "The Parametric Plot creates custom graphs of the Parametric Explorer results. ");
MGCAddSnippet(125, "The Verify Contour window enables inspection of the post-run layout.");
MGCAddSnippet(126, "When you interact with the RET Selection window, commands are echoed to the Command Window and Log Window as well as the terminal from which Calibre WORKbench was invoked. You can use the commands to create Tcl scripts to run Calibre pxSMO without a GUI.");
MGCAddSnippet(127, "Commands that begin  mdf gauges  control operations on the gauge file.");
MGCAddSnippet(128, "The commands that begin  mdf litho  configure sessions.");
MGCAddSnippet(129, "Commands that begin  mdf smo  control the runs (for example, pre-SMO or Verify). ");
MGCAddSnippet(130, "The process window object commands act on a process window object created by mdf smo pwa new. Use them to customize common process window calculations.");
MGCAddSnippet(131, "Sessions in different layout/gauge pairs cannot be compared in the plots even if the layout and gauges are identical. You can use a short command-line script to move the session to another layout/gauge pair.");
MGCAddSnippet(132, "This chapter summarizes the best practices for running Calibre pxSMO and the Calibre RET Selection interface.");
MGCAddSnippet(133, "There are several things that can improve your optimized source or mask, but are too case-specific for inclusion in the procedures.");
MGCAddSnippet(134, "These process window recommendations have been developed from extensive testing. Settings are relative to those used in the Calibre OPCverify setup file unless otherwise noted.");
MGCAddSnippet(135, "This chapter describes file formats used in Calibre RET Selection:");
MGCAddSnippet(136, "The clip file contains information about clipping rectangles and their properties, relevant for setting boundary conditions, and taking advantage of possible periodicities.");
MGCAddSnippet(137, "The RET Selection setup file can be used instead of a litho model when creating a new layout/gauge pair in the RET Selection GUI. If you use the other choice in the wizard, Lithomodel, at the end of the setup the wizard exports a RET Selection setup file.");
MGCAddSnippet(138, "It is useful to understand the system flow and runscripts used by the RET Selection GUI.");
MGCAddSnippet(139, "The system flow in the RET Selection interface and Calibre pxSMO involves the use of specialized runscripts that are executed by optimization jobs.");
MGCAddSnippet(140, "The runscript file can be customized, usually by a system administrator. All runscripts have specific requirements for use, but can be written in any scripting language.");
MGCAddSnippet(141, "The run_lsf.sh runscript executes sessions within the RET Selection environment using the Platform LSF distribution system.");
MGCAddSnippet(142, "");
MGCAddSnippet(143, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

